import React from 'react';

const Berita = () => {

        const news = [
          { id: 1, title: 'Berita 1', description: 'Ini adalah deskripsi berita pertama.' },
          { id: 2, title: 'Berita 2', description: 'Ini adalah deskripsi berita kedua.' },
          { id: 3, title: 'Berita 3', description: 'Ini adalah deskripsi berita ketiga.' }
        ];
      
        return (
          <div className="p-4">
            {news.map(item => (
              <div key={item.id} className="border-b pb-4 mb-4">
                <h2 className="text-xl font-semibold">{item.title}</h2>
                <p className="text-gray-600">{item.description}</p>
              </div>
            ))}
          </div>
        );
      }



export default Berita;
